import react from "react";

const PricingToggle = () => {
  return (
    <div className="m-container">
      <div className="">
        <h2>PLANS</h2>
      </div>

      <style global jsx>{`
        h2 {
          color: white;
          text-align: center;
        }
      `}</style>
    </div>
  );
};

export default PricingToggle;
